import {Link} from 'react-router-dom';
import {useState} from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
function SignUp() {
    const [mentee,setMentee]=useState(false);
    const [mentor,setMentor]=useState(false);

    const clickRedirect=(mentee,mentor)=>{
        if(mentee)<Link to="/mentee"/>
        else <Link to="/mentor"/>

        setMentee(false);
        setMentor(false);

    }
    return (


        <>
        <Header/>
            <div className="grid grid-cols-2 mt-30 px-5 py-6">
                <div>
                    <img src="https://raw.githubusercontent.com/sanyagoyal2000/Pictures/c0267aeea9eefb64a8060a4a4873b94cae44b7f3/undraw_authentication_fsn5.svg" alt="signup"/>
                </div>
                <div className="mt-20 ml-5">
               <form className="flex flex-col bg-gray-100 rounded shadow-lg p-12 mt-12">
                   <h1 className="text-gray-800 font-semibold ">Not registered Yet</h1>
                   <hr/>
                   <br/>

                   <div className="flex flex-row items-center">
                   <input type="radio" name="mentor" value={mentor} onClick={()=>setMentor(true)} className="ml-10 mr-5"/>
                  <label >Mentor</label><br/>
                  <input type="radio" id="css" name="mentee" value={mentee} onClick={()=>setMentee(true)} className="ml-10"/>
                 <label >Mentee</label><br/><br/>
                 </div>
                 <button className="bg-green-600 text-white active:bg-pink-600 font-bold uppercase text-xs mt-4 px-4 py-2 rounded shadow hover:shadow-md outline-none focus:outline-none mr-1 ease-linear transition-all duration-150" type="submit" onClick={clickRedirect}>
          GO TO YOUR RESPECTIVE PAGE
        </button>

               </form>
               </div>
           </div>
           <Footer/>
        </>
    )
}

export default SignUp
